// Add this to your GroupPage component state
const [hoveredMember, setHoveredMember] = useState(null);
const [popupPosition, setPopupPosition] = useState({ x: 0, y: 0 });

// Sample member data - you can customize this based on your needs
const memberDetails = {
  'MB': { name: 'Mike Brown', role: 'Admin', joinDate: 'Jan 2024', contribution: '$1,500' },
  'AJ': { name: 'Alex Johnson', role: 'Member', joinDate: 'Feb 2024', contribution: '$1,200' },
  'NL': { name: 'Nina Lopez', role: 'Member', joinDate: 'Mar 2024', contribution: '$1,000' },
  'HC': { name: 'Henry Chen', role: 'Member', joinDate: 'Apr 2024', contribution: '$800' },
  'HW': { name: 'Helen White', role: 'Treasurer', joinDate: 'Jan 2024', contribution: '$1,500' },
  'AD': { name: 'Anna Davis', role: 'Member', joinDate: 'May 2024', contribution: '$600' },
  'BC': { name: 'Bob Clark', role: 'Member', joinDate: 'Jun 2024', contribution: '$400' },
  'CD': { name: 'Carol Davis', role: 'Member', joinDate: 'Jul 2024', contribution: '$300' },
  'AA': { name: 'Alice Anderson', role: 'Admin', joinDate: 'Aug 2024', contribution: '$2,000' },
  'BB': { name: 'Ben Baker', role: 'Member', joinDate: 'Sep 2024', contribution: '$1,800' },
  'CC': { name: 'Chris Cooper', role: 'Member', joinDate: 'Oct 2024', contribution: '$1,600' },
  'DD': { name: 'Diana Davis', role: 'Member', joinDate: 'Nov 2024', contribution: '$1,400' }
};

// Handle mouse enter on member
const handleMemberMouseEnter = (member, event) => {
  const rect = event.target.getBoundingClientRect();
  setPopupPosition({
    x: rect.right + 10,
    y: rect.top + rect.height / 2 - 60
  });
  setHoveredMember(member);
};

// Handle mouse leave on member
const handleMemberMouseLeave = () => {
  setHoveredMember(null);
};

// Updated CustomMemberCircle component
const CustomMemberCircle = ({ groupData, hidden, animationsLoaded }) => {
  return (
    <div className={`circle-wrapper ${animationsLoaded ? 'animate-circle' : ''}`}>
      <div className="dotted-circle"></div>

      {/* Rotating members container */}
      <div className={`members-container ${animationsLoaded ? 'animate-members' : ''}`}>
        {groupData.members.map((member, index) => {
          const position = getMemberPosition(index, groupData.members.length);
          return (
            <div
              key={index}
              className="member-wrapper"
              style={{ ...position }}
            >
              <div 
                className="member"
                onMouseEnter={(e) => handleMemberMouseEnter(member, e)}
                onMouseLeave={handleMemberMouseLeave}
              >
                {member}
              </div>
            </div>
          );
        })}
      </div>

      {/* Center info */}
      <div className="center-info">
        <h2>{hidden ? '••••' : groupData.poolSize}</h2>
        <p>Pool Size</p>
        <div style={{ marginTop: '10px' }}>
          <h2 style={{ fontSize: '2rem', color: '#48cae4' }}>
            {hidden ? '••••' : groupData.groupBalance}
          </h2>
          <p style={{ fontSize: '1.2rem' }}>Available</p>
        </div>
      </div>

      {/* Popup */}
      {hoveredMember && memberDetails[hoveredMember] && (
        <div 
          className="member-popup"
          style={{
            left: `${popupPosition.x}px`,
            top: `${popupPosition.y}px`
          }}
        >
          <div className="popup-content">
            <div className="popup-arrow"></div>
            <h4>{memberDetails[hoveredMember].name}</h4>
            <div className="popup-details">
              <p><strong>Role:</strong> {memberDetails[hoveredMember].role}</p>
              <p><strong>Joined:</strong> {memberDetails[hoveredMember].joinDate}</p>
              <p><strong>Contribution:</strong> {memberDetails[hoveredMember].contribution}</p>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};
